import React from 'react'
import {BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';
function Home() {
  return (
    <div>
       <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<Signup />} />
            </Routes>
    </div>
  )
}

export default Home
